create table cp_sensor_data
(
    id           varchar(64)  not null comment '主键'
        primary key,
    cp_sensor_id varchar(64)  not null comment '传感器主键ID',
    msg          varchar(255) null comment '消息',
    update_date  datetime     null comment '数据更新的时间',
    flag         varchar(255) null comment '00表示请求成功01表示请求失败',
    sensor_name  varchar(255) null comment '传感器名称',
    user_name    varchar(255) null comment '用户名',
    device_id    int          null comment '设备ID',
    user_id      int          null comment '用户ID',
    sensor_id    int          null comment '传感器ID',
    unit         varchar(255) null comment '数值单位',
    sensor_type  varchar(255) null comment '传感器类型 数值类型',
    is_line      varchar(255) null comment '是否在线',
    value        varchar(255) null comment '数值',
    is_alarms    varchar(255) null comment '是否报警',
    lat          varchar(255) null comment '经度',
    lng          varchar(255) null comment '纬度',
    switcher     varchar(255) null comment '开关值 0表示关 1表示开'
)
    comment '传感器数据表';

